description:
[BackroomCastingCouch] Cindy (10.13.2014)

Cindy is cute enough but I would have expected a girl who looks like that to be more...easy. And a whole lot better at following directions. Instead it's like pulling teeth to get anywhere with this ditz, what with all the giggling and &quot;I can't believe I'm doing this&quot; reactions. Oddly enough, despite the constant struggling I'm rock hard before 21 year old Cindy ever takes off her clothes. Or maybe it's because of it. I do like a challenge. Although, this one will test your patience. It all makes sense when Cindy reveals something about herself at the very end that'll blow your mind - just watch.

